program ATM_Sederhana;

uses crt;

var
  saldo, tarik, setor, jumlah : integer;

begin
  clrscr;
  writeln('Selamat datang di ATM Sederhana');
  writeln('Silahkan masukkan jumlah saldo awal Anda : ');
  readln(saldo);
  writeln('Saldo Anda saat ini adalah : ', saldo);
  writeln('Apakah Anda ingin melakukan transaksi lainnya ?');
  writeln('1. Tarik Tunai');
  writeln('2. Setor Tunai');
  writeln('3. Keluar');
  write('Pilihan Anda : ');
  readln(jumlah);
  case jumlah of
    1 : begin
          writeln('Masukkan jumlah uang yang akan ditarik : ');
          readln(tarik);
          if tarik > saldo then
            writeln('Maaf, saldo Anda tidak mencukupi')
          else
            begin
              saldo := saldo - tarik;
              writeln('Transaksi berhasil');
              writeln('Saldo Anda saat ini adalah : ', saldo);
            end;
        end;
    2 : begin
          writeln('Masukkan jumlah uang yang akan disetor : ');
          readln(setor);
          saldo := saldo + setor;
          writeln('Transaksi berhasil');
          writeln('Saldo Anda saat ini adalah : ', saldo);
        end;
    3 : writeln('Terima kasih telah menggunakan ATM Sederhana');
  end;
  readln;
end.

